sparql:
SELECT DISTINCT ?item ?itemLabel WHERE {
  SERVICE wikibase:label { bd:serviceParam wikibase:language "[AUTO_LANGUAGE]". }
  {
    SELECT DISTINCT ?item WHERE {
      ?item p:P10 ?statement0.
      ?statement0 (ps:P10) _:anyValueP10.
      ?item p:P1080 ?statement1.
      ?statement1 (ps:P1080/(wdt:P279*)) _:anyValueP1080.
    }
    LIMIT 100
  }
}
